      string: "{\r\n  \"name\" : \"Haiman2025 - RBC-GEM, v1.2.0, proteome-constrained\",\r\n
        \ \"description\" : \"Initial submission of the proteome-constrained RBC-GEM
        genome-scale metabolic model, version 1.2.0. Constraints were formulated using
        a modified version of the OVERLAY computational pipeline (PMID: 36650525).
        The model is parameterized using the REDS RBC Omics dataset (PMID: 38964323).
        Flux bounds of the representative model were set using the minimum/maximum
        values, determined via flux variability analyses, across all generated context-specific
        proteome-constrained models.\",\r\n  \"format\" : {\r\n    \"name\" : \"SBML\",\r\n
        \   \"identifier\" : \"SBML\",\r\n    \"version\" : \"L3V1\"\r\n  },\r\n  \"publication\"
        : {\r\n    \"type\" : \"DOI\",\r\n    \"accession\" : \"10.1371/journal.pcbi.1012109\",\r\n
        \   \"journal\" : \"PLoS computational biology\",\r\n    \"title\" : \"RBC-GEM:
        A genome-scale metabolic model for systems biology of the human red blood
        cell.\",\r\n    \"affiliation\" : \"Department of Bioengineering, University
        of California San Diego, La Jolla, California, United States of America.\",\r\n
        \   \"synopsis\" : \"Advancements with cost-effective, high-throughput omics
        technologies have had a transformative effect on both fundamental and translational
        research in the medical sciences. These advancements have facilitated a departure
        from the traditional view of human red blood cells (RBCs) as mere carriers
        of hemoglobin, devoid of significant biological complexity. Over the past
        decade, proteomic analyses have identified a growing number of different proteins
        present within RBCs, enabling systems biology analysis of their physiological
        functions. Here, we introduce RBC-GEM, one of the most comprehensive, curated
        genome-scale metabolic reconstructions of a specific human cell type to-date.
        It was developed through meta-analysis of proteomic data from 29 studies published
        over the past two decades resulting in an RBC proteome composed of more than
        4,600 distinct proteins. Through workflow-guided manual curation, we have
        compiled the metabolic reactions carried out by this proteome to form a genome-scale
        metabolic model (GEM) of the RBC. RBC-GEM is hosted on a version-controlled
        GitHub repository, ensuring adherence to the standardized protocols for metabolic
        reconstruction quality control and data stewardship principles. RBC-GEM represents
        a metabolic network is a consisting of 820 genes encoding proteins acting
        on 1,685 unique metabolites through 2,723 biochemical reactions: a 740% size
        expansion over its predecessor. We demonstrated the utility of RBC-GEM by
        creating context-specific proteome-constrained models derived from proteomic
        data of stored RBCs for 616 blood donors, and classified reactions based on
        their simulated abundance dependence. This reconstruction as an up-to-date
        curated GEM can be used for contextualization of data and for the construction
        of a computational whole-cell models of the human RBC.\",\r\n    \"year\"
        : 2025,\r\n    \"month\" : \"3\",\r\n    \"volume\" : \"21\",\r\n    \"issue\"
        : \"3\",\r\n    \"pages\" : \"e1012109\",\r\n    \"link\" : \"http://identifiers.org/doi/10.1371/journal.pcbi.1012109\",\r\n
        \   \"authors\" : [\r\n      {\r\n        \"name\" : \"Zachary B Haiman\",\r\n
        \       \"institution\" : \"Department of Bioengineering, University of California
        San Diego, La Jolla, California, United States of America.\",\r\n        \"orcid\"
        : \"0000-0001-6175-5050\"\r\n      },\r\n      {\r\n        \"name\" : \"Alicia
        Key\",\r\n        \"institution\" : \"Department of Biochemistry and Molecular
        Genetics, University of Colorado Anschutz Medical Campus, Aurora, Colorado,
        USA.\",\r\n        \"orcid\" : \"0000-0002-8787-8144\"\r\n      },\r\n      {\r\n
        \       \"name\" : \"Angelo D'Alessandro\",\r\n        \"institution\" : \"Department
        of Biochemistry and Molecular Genetics, University of Colorado Anschutz Medical
        Campus, Aurora, Colorado, USA.\",\r\n        \"orcid\" : \"0000-0002-2258-6490\"\r\n
        \     },\r\n      {\r\n        \"name\" : \"Bernhard O Palsson\",\r\n        \"institution\"
        : \"Department of Bioengineering, University of California San Diego, La Jolla,
        California, United States of America.Department of Pediatrics, University
