      string: "{\r\n  \"name\" : \"Miroshnichenko2025 - A modular model of immune
        response to SARS-CoV-2 infection\",\r\n  \"description\" : \"A multicompartmental
        model consisting of four submodules: the lungs, the upper airways, and the
        corresponding lymph nodes for both submodules. The model is made up of 35
        differential equations (including ODEs and DDEs) and 112 parameters.\",\r\n
        \ \"format\" : {\r\n    \"name\" : \"COMBINE archive\",\r\n    \"identifier\"
        : \"OMEX\",\r\n    \"version\" : \"0.1\"\r\n  },\r\n  \"publication\" : {\r\n
        \   \"type\" : \"DOI\",\r\n    \"accession\" : \"10.3390/v17050589\",\r\n
        \   \"journal\" : \"Viruses\",\r\n    \"title\" : \"A Modular Mathematical
        Model of the Immune Response for Investigating the Pathogenesis of Infectious
        Diseases.\",\r\n    \"affiliation\" : \"Department of Computational Biology,
        Scientific Center for Genetics and Life Sciences, Sirius University of Science
        and Technology, 354340 Sochi, Russia.\",\r\n    \"synopsis\" : \"The COVID-19
        pandemic highlighted the importance of mathematical modeling for understanding
        viral infection dynamics and accelerated its application into immunological
        research. Collaborative efforts among international research groups yielded
        a wealth of experimental data, which facilitated model development and validation.
        This study focuses on developing a modular mathematical model of the immune
        response, capturing the interactions between innate and adaptive immunity,
        with an application to SARS-CoV-2 infection. The model was validated using
        experimental data from middle-aged individuals with moderate COVID-19 progression,
        including measurements of viral load in the upper and lower airways, serum
        antibodies, CD4+ and CD8+ T cells, and interleukin-6 levels. Parameter optimization
        and sensitivity analysis were performed to improve the model accuracy. Additionally,
        identifiability analysis was conducted to assess whether the data were sufficient
        for reliable parameter estimation. The verified model simulates the dynamics
        of moderate, severe, and critical COVID-19 progressions using measured data
        on lung epithelium damage, viral load, and IL-6 levels as key indicators of
        disease severity. We also performed a series of validation scenarios to assess
        whether the model correctly reproduces biologically relevant behaviors under
        various conditions, such as immunity hyperactivation, co-infection with HIV,
        and interferon administration as a therapeutic strategy. The model was developed
        as a component of the Digital Twin project and represents a general immune
        module that integrates both innate and adaptive immunity. It can be utilized
        for further COVID-19 research or serve as a foundation for studying other
        infectious diseases, provided sufficient data are available.\",\r\n    \"year\"
        : 2025,\r\n    \"month\" : \"4\",\r\n    \"volume\" : \"17\",\r\n    \"issue\"
        : \"5\",\r\n    \"pages\" : \"589\",\r\n    \"link\" : \"http://identifiers.org/doi/10.3390/v17050589\",\r\n
        \   \"authors\" : [\r\n      {\r\n        \"name\" : \"Maxim I Miroshnichenko\",\r\n
        \       \"institution\" : \"Department of Computational Biology, Scientific
        Center for Genetics and Life Sciences, Sirius University of Science and Technology,
        354340 Sochi, Russia.\",\r\n        \"orcid\" : \"0009-0008-0843-6083\"\r\n
        \     },\r\n      {\r\n        \"name\" : \"Fedor A Kolpakov\",\r\n        \"institution\"
        : \"Department of Computational Biology, Scientific Center for Genetics and
        Life Sciences, Sirius University of Science and Technology, 354340 Sochi,
        Russia.\"\r\n      },\r\n      {\r\n        \"name\" : \"Ilya R Akberdin\",\r\n
        \       \"institution\" : \"Biosoft.ru, 630058 Novosibirsk, Russia.Department
