      string: "{\r\n  \"name\" : \"Masison2024 - Enterocyte Iron Mucosal Block\",\r\n
        \ \"description\" : \"<notes xmlns=\\\"http://www.sbml.org/sbml/level2/version5\\\">
        \     <body xmlns=\\\"http://www.w3.org/1999/xhtml\\\">        <h1>Enterocyte
        Iron Mucosal Block</h1>        <p>This is a model of enterocyte iron absorption,
        consisting of iron uptake (movement of iron from intestinal lumen into cytplasm),
        and transfer (transport of iron from cytoplasm to blood/plasma).  The model
        was created by Joseph Masison and Pedro Mendes.</p>        <p>Intestinal mucosal
        block is a cellular phenomenon defined by a transient reduction in iron absorption
        by intestinal epithelial cells following previous iron exposures. Understanding
        what controls the mucosal block is central to understanding how intestinal
        iron absorption contributes to pathological iron states. Three mechanisms
        implicated in driving mucosal block are the endocytosis of divalent metal
        transporter 1 (DMT1), sequestration of iron by cytosolic ferritin, and iron
        regulatory proteins (IRPs) regulation of ferritin expression. </p>        <p>Here,
        we build a model that reproduces the mucosal block phenomena, based on published
        experimental data, and use it to quantify the contribution of each mechanism
        to the block. Model analysis shows ferritin and IRPs regulation have the largest
        quantitative impact on the mucosal block. Lastly, DMT1 endocytosis is shown
        to play a role in limiting total enterocyte iron uptake, protecting the cell
        against oxidative stress, but does not contribute to the decrease in total
        iron transfer seen in mucosal block.</p>        <p style=\\\"font-size:small\\\">
        \         <b>CC0 1.0 Universal</b>: To the extent possible under law, all
        copyright and related or neighbouring rights to this encoded model have been
        dedicated to the public domain worldwide. You can copy, modify, distribute
        and perform the work, even for commercial purposes, all without asking permission.
        Please refer to <a href=\\\"http://creativecommons.org/publicdomain/zero/1.0/\\\"
        title=\\\"Creative Commons CC0\\\">CC0 Public Domain Dedication</a> for more
        information.</p>        </body>    </notes>\",\r\n  \"format\" : {\r\n    \"name\"
        : \"SBML\",\r\n    \"identifier\" : \"SBML\",\r\n    \"version\" : \"L2V5\"\r\n
        \ },\r\n  \"publication\" : {\r\n    \"type\" : \"Publication without link\",\r\n
        \   \"accession\" : \"10.1371/journal.pcbi.1012374\",\r\n    \"journal\" :
        \"PLOS Computational Biology\",\r\n    \"title\" : \"Mathematical modeling
        reveals ferritin as the strongest cellular driver of dietary iron transfer
        block in enterocytes\",\r\n    \"affiliation\" : \"Center for Cell Analysis
        and Modeling, University of Connecticut School of Medicine, Farmington, Connecticut,
        United States of America\",\r\n    \"synopsis\" : \"Intestinal mucosal block
        is the transient reduction in iron absorption ability of intestinal epithelial
        cells (enterocytes) in response to previous iron exposures that occur at the
        cell scale. The block characteristics have been shown to depend both on iron
        exposure magnitude and temporality, and understanding block control will enable
        deeper understanding of how intestinal iron absorption contributes to pathological
        iron states. Three biochemical mechanisms implicated in driving the block
        behavior are divalent metal transporter 1 endocytosis, ferritin iron sequestration,
        and iron regulatory protein regulation of iron related protein expression.
        In this work, a model of enterocyte iron metabolism is built based on published
        experimental data that is capable of reproducing the mucosal block phenomena.
        The model is then used to estimate the quantitative contribution of each of
        the three mechanisms on the properties of the mucosal block. Analysis reveals
        that ferritin and iron regulatory proteins are the main intracellular mechanisms
        contributing to the mucosal block, findings congruent with experimental predictions.
        Lastly, DMT1 endocytosis is shown to play a role in limiting total iron uptake
        by enterocytes but does not contribute to the decrease in total iron transfer
        across their basal membrane seen in the mucosal block.\",\r\n    \"year\"
        : 2025,\r\n    \"month\" : \"3\",\r\n    \"volume\" : \"21\",\r\n    \"issue\"
